const styles = StyleSheet.create({
    row: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'space-around',
      flexDirection: 'row',
      height: '100%',
      backgroundColor: colors.white
    },
    post:{
      height:normalize(16*90),
      alignItems:'center',
      justifyContent:'center',
      width: '49.4%',
      backgroundColor: colors.black
    }
  });

export default styles
